import tkinter as tk
from tkinter import messagebox, filedialog
import time
import csv
import threading
import base64

# 1) Paste your Base64 string here (shortened example shown; yours will be much longer)
ICON_PNG_BASE64 = b"""

"""

class TaskTimerApp:
    def __init__(self, root):
        self.root = root
        self.root.title("Track My Hours")

        # 2) Decode the base64 string and create a PhotoImage
        icon_data = base64.b64decode(ICON_PNG_BASE64)
        icon_image = tk.PhotoImage(data=icon_data)
        self.root.iconphoto(False, icon_image)

        # State variables
        self.current_task = None
        self.task_start_time = 0
        self.is_timing = False
        self.recorded_tasks = []
        self.notified_30_minutes = False

        # Label & entry for task name
        self.task_name_label = tk.Label(root, text="Input your task name:")
        self.task_name_label.pack(pady=5)

        self.task_name_entry = tk.Entry(root)
        self.task_name_entry.pack(pady=5)

        # Dropdown for notification interval
        self.notification_interval_var = tk.StringVar(value="30")
        interval_label = tk.Label(root, text="Select your task timer reminder interval (minutes):")
        interval_label.pack(pady=5)

        interval_options = ["15", "30", "60", "Never"]
        interval_menu = tk.OptionMenu(root, self.notification_interval_var, *interval_options)
        interval_menu.pack(pady=5)

        # Buttons
        self.start_button = tk.Button(root, text="Start Task", command=self.start_task)
        self.start_button.pack(pady=5)

        self.stop_button = tk.Button(root, text="Stop Task", command=self.stop_task, state="disabled")
        self.stop_button.pack(pady=5)

        self.view_tasks_button = tk.Button(root, text="View / Export Tasks", command=self.view_tasks)
        self.view_tasks_button.pack(pady=5)

        # Elapsed time label
        self.elapsed_time_label = tk.Label(root, text="No active task", font=("Arial", 12, "bold"))
        self.elapsed_time_label.pack(pady=10)

        # Start notification thread
        self.notification_thread = threading.Thread(target=self.check_notifications, daemon=True)
        self.notification_thread.start()

        # Recurring timer update
        self.update_elapsed_time()

    def start_task(self):
        if self.is_timing:
            messagebox.showinfo("Info", "A task is already running. Stop it first.")
            return

        task_name = self.task_name_entry.get().strip()
        if not task_name:
            messagebox.showwarning("Warning", "Please enter a task name.")
            return

        self.current_task = task_name
        self.task_start_time = time.time()
        self.is_timing = True
        self.notified_30_minutes = False
        self.start_button.config(state="disabled")
        self.stop_button.config(state="normal")

    def stop_task(self):
        if not self.is_timing:
            return

        end_time = time.time()
        duration_seconds = end_time - self.task_start_time

        hrs = int(duration_seconds // 3600)
        mins = int((duration_seconds % 3600) // 60)
        duration_str = f"{hrs:02}:{mins:02}"

        task_info = {
            "name": self.current_task,
            "duration_str": duration_str,
            "start_timestamp": self.task_start_time,
            "end_timestamp": end_time
        }
        self.recorded_tasks.append(task_info)

        self.current_task = None
        self.is_timing = False
        self.start_button.config(state="normal")
        self.stop_button.config(state="disabled")

        messagebox.showinfo(
            "Task Stopped",
            f"Task '{task_info['name']}' recorded for {duration_str} (HH:MM)."
        )

    def view_tasks(self):
        if not self.recorded_tasks:
            messagebox.showinfo("No Tasks", "No tasks recorded yet.")
            return

        task_summary = ""
        for i, t in enumerate(self.recorded_tasks, start=1):
            task_summary += f"{i}. {t['name']} - {t['duration_str']} (HH:MM)\n"

        response = messagebox.askquestion(
            "Tasks",
            f"Tasks recorded:\n\n{task_summary}\n\nExport to CSV?"
        )
        if response == "yes":
            self.export_csv()

    def export_csv(self):
        file_path = filedialog.asksaveasfilename(
            defaultextension=".csv",
            filetypes=[("CSV files", "*.csv")],
            title="Save Task Data As..."
        )
        if not file_path:
            return

        with open(file_path, "w", newline="") as csvfile:
            writer = csv.writer(csvfile)
            writer.writerow(["Task Name", "Date Recorded", "Start DateTime", "End DateTime", "Duration HH:MM"])

            for t in self.recorded_tasks:
                date_str = time.strftime("%d/%m/%Y", time.localtime(t["start_timestamp"]))
                start_time_str = time.strftime("%d/%m/%Y %H:%M:%S", time.localtime(t["start_timestamp"]))
                end_time_str = time.strftime("%d/%m/%Y %H:%M:%S", time.localtime(t["end_timestamp"]))

                writer.writerow([
                    t["name"],
                    date_str,
                    start_time_str,
                    end_time_str,
                    t["duration_str"]
                ])
        messagebox.showinfo("Export Complete", f"Tasks exported to {file_path}")

    def check_notifications(self):
        check_interval = 10
        while True:
            if self.is_timing and not self.notified_30_minutes:
                user_selection = self.notification_interval_var.get()
                if user_selection != "Never":
                    notification_interval = int(user_selection) * 60
                    elapsed = time.time() - self.task_start_time
                    if elapsed >= notification_interval:
                        self.root.after(0, self.prompt_continue_or_stop)
            time.sleep(check_interval)

    def prompt_continue_or_stop(self):
        self.notified_30_minutes = True
        response = messagebox.askyesno(
            "Continue Task?",
            f"You have been working on '{self.current_task}' "
            f"for {self.notification_interval_var.get()} minutes.\n\nContinue timing?"
        )
        if not response:
            self.stop_task()

    def update_elapsed_time(self):
        if self.is_timing:
            elapsed_seconds = int(time.time() - self.task_start_time)
            hrs = elapsed_seconds // 3600
            mins = (elapsed_seconds % 3600) // 60
            secs = elapsed_seconds % 60
            self.elapsed_time_label.config(
                text=f"Current Task: {self.current_task}\nElapsed: {hrs:02d}:{mins:02d}:{secs:02d}"
            )
        else:
            self.elapsed_time_label.config(text="No active task")
        self.root.after(1000, self.update_elapsed_time)

def run_app():
    root = tk.Tk()
    app = TaskTimerApp(root)
    root.mainloop()

if __name__ == "__main__":
    run_app()